import React from 'react';
import './style.css';



export default class Sign extends React.Component{
    render(){
        return (
            <div>
        <div className="signDiv1">
            <div className="signCon1">

            </div>

            <div className="signCon2">
                <input type="text" placeholder="First Name" className="fname"></input>
                <input type="text" placeholder="Last Name" className="fname"></input>
                <input type="email" placeholder="Email Name" className="fname"></input>
                <input type="password" placeholder="Password" className="fname"></input><br/>
                <input type="button" value="Submit" className="fname1"></input>
                
            </div>
        </div>
        </div>
        
        );
    }
}
